import React from 'react';
import Carrosel from '../../components/carrossel';

function SaibaMais({CarroselItems}){
    return(
        <>
            <Carrosel CarroselItems={CarroselItems}/>
            <div id="info-plus">

                <div className="button-return">

                </div>

            </div>
        </>
    )
}

export default SaibaMais;
